# Parse the XML spreadsheet file
try:
    tree = ET.parse('/workspace/budget.xlsx')
except ET.ParseError as e:
    print(f"Error parsing XML: {e}")
    raise

root = tree.getroot()

# Define namespace mapping, note that the default namespace might be set without a prefix
ns = {'ss': 'urn:schemas-microsoft-com:office:spreadsheet'}

# Register namespace to preserve it during write
ET.register_namespace('', ns['ss'])

# Iterate through all Data elements in the spreadsheet
# They typically have tag {urn:schemas-microsoft-com:office:spreadsheet}Data
for data_elem in root.findall('.//{urn:schemas-microsoft-com:office:spreadsheet}Data'):
    # Check the attribute for type. In some files, it may appear as ss:Type
    data_type = data_elem.get('{urn:schemas-microsoft-com:office:spreadsheet}Type')
    if data_elem.text is None:
        continue
    # Process if the cell is marked as Number or if the text is numerically convertible
    if data_type and data_type.lower() == 'number':
        try:
            original_value = float(data_elem.text)
            new_value = original_value * 1.1
            # Preserve integer if applicable
            if original_value.is_integer():
                data_elem.text = str(int(round(new_value)))
            else:
                data_elem.text = str(new_value)
        except ValueError:
            pass
    else:
        # Try to convert text to float anyway
        try:
            original_value = float(data_elem.text)
            new_value = original_value * 1.1
            if original_value.is_integer():
                data_elem.text = str(int(round(new_value)))
            else:
                data_elem.text = str(new_value)
        except ValueError:
            continue

# Write out the updated XML back to the same file
tree.write('/workspace/budget.xlsx', encoding='utf-8', xml_declaration=True)

print('Successfully updated /workspace/budget.xlsx by increasing all numeric values by 10%')

